import React from 'react';

interface Item {
  id:number,
  product:string,
  quantity:number
}

interface ShoppingListProps {
  items: Item[];
}

const Todos = ({items}:{items:{
  id:number
}[]}): JSX.Element => {

  return (

    <div>
      <h1>Shopping List</h1>
      <ul>
        {items.map( (item) => (
          <li>{item.product}-{item.quantity}</li>
        ))}


      </ul>
    </div>
  )
}

export default Todos;
